/******************************************************************************
 *  Compilation:  javac Player.java
 *  Execution:    java -classpath .:cards.jar Player
 *  Dependencies: Card.java Draw.java
 *
 *  Implement a player that holds a pile of cards.
 *
 ******************************************************************************/

public class Player { 
    final static int MAX_CARDS = 52;                    // max number of cards in a hand

    public Card[] cards = new Card[MAX_CARDS];         // the cards
    public int N = 0;                                  // number of cards
    public String name;                                // player's name
    public int x, y;                                   // location to draw

    public Player(String name, int x, int y) {
        this.name = name;
        this.x = x;
        this.y = y;
    }

    public Card peak()         { return cards[0];   }    // return first card
    public void dealTo(Card c) { cards[N++] = c;    }    // insert card
    public void reset()        { N = 0;             }    // discard all cards

    // compute value of blackjack hand
    public int value() {
        int val = 0;
        boolean hasAce = false;
        for (int i = 0; i < N; i++) {
            val = val + cards[i].rank();
            if (cards[i].isAce()) hasAce = true;
        }
        if (hasAce && (val <= 11)) val = val + 10;          // handle ace = 1 or 11
        return val;
    }

    // draw the pile of cards, with the first one centered at (x, y)
    public void draw(Draw d) {
        for (int i = 0; i < N; i++)
            cards[i].draw(d, x + i*25, y);
    }

    // print out cards in player's hand (for debugging)
    public String toString() {
        String s = name + "  (" + value() + ")  ";
        for (int i = 0; i < N; i++)
            s += cards[i] + " ";
        return s;
    }

}

/******************************************************************************
 *  Compilation:  javac Deck.java Card.java
 *  Execution:    java -classpath .:cards.jar Player
 *
 *  Implement a deck of cards.
 *
 ******************************************************************************/

public class Deck { 
    final static int DECK_SIZE = 52;

    public Card[] cards;         // the cards  - cards[0] is bottom of deck
    public int N;                // number of cards

    public Deck()  {
        N = DECK_SIZE;
        cards = new Card[N];
        for (int i = 0; i < N; i++)
            cards[N - i - 1] = new Card(i, i + ".gif", "back.gif");
    }

    public Card dealFrom()   { return cards[--N]; }
    public boolean isEmpty() { return (N == 0);   }
    public int size()        { return N;          }


    // shuffles cards
    public void shuffle() {
        for (int i = 0; i < N; i++) {
            int r = (int) (Math.random() * i);
            Card swap = cards[i];
            cards[i]  = cards[r];
            cards[r]  = swap;
        }
    }



    public String toString() {
        String s = "Deck  ";
        for (int i = N - 1; i >= 0; i--)
            s += cards[i] + " ";
        return s;
    }


   // test client
   public static void main(String[] args) { 
      Deck deck = new Deck();
      StdOut.println(deck);
      deck.shuffle();
      StdOut.println(deck);
   }

}

/******************************************************************************
 *  Compilation:  javac Card.java
 *  Execution:    java -classpath .:cards.jar Card
 *  Dependencies: Draw.java
 *
 *  Implement a playing card in a standard 52 card deck.

 *  Assumes cards.jar is in the current directory and contains
 *  images of the cards named: 2c.gif, 2d, 2h, 2s, ..., as.gif.
 *
 ******************************************************************************/

public class Card { 
    public int suit;
    public int rank;
    public String front;
    public String back;
    public boolean isConcealed;

    // create a new card based on integer 0 = 2C, 1 = 3C, ..., 51 = AS
    Card(int card, String front, String back) {
        this.rank   = card % 13;
        this.suit   = card / 13;
        this.front  = front;
        this.back   = back;
        isConcealed = false;
    }

    public boolean isAce() { return rank == 12; }

    // 1 for ace, 10 for jqk, actual rank for other cards
    public int rank()  {
        if (rank == 12) return  1;
        if (rank >=  8) return 10;
        return rank + 2;
    }

    public void draw(Draw d, double x, double y)  {
        if (isConcealed) d.picture(x, y, back);
        else             d.picture(x, y, front);
    }


    public void conceal() { isConcealed = true;  }
    public void reveal()  { isConcealed = false; }

    // represent cards like "2H", "9C", "JS", "AD"
    public String toString() {
        String ranks = "23456789TJQKA";
        String suits = "CDHS";
        return ranks.charAt(rank) + "" + suits.charAt(suit);
    }


}

import javax.swing.JFrame;
import javax.swing.JButton;
import javax.swing.JLabel;
import javax.swing.JPanel;
import javax.swing.BoxLayout;

import java.awt.event.ActionEvent;
import java.awt.event.ActionListener;

import java.awt.Color;

import java.awt.Dimension;

public class BlackJack extends JFrame implements ActionListener {
    public static final int WIDTH = 400, HEIGHT = 300;

    public Deck deck;
    Draw draw = new Draw();
    public JLabel main = draw.getJLabel();

    public Player gambler = new Player("Gambler", 100,   75);
    public Player dealer  = new Player("Dealer",  100,  225);

    public JButton hitButton   = new JButton("Hit Me");
    public JButton stickButton = new JButton("Stick");
    public JButton dealButton  = new JButton("Deal");

    public JLabel status = new JLabel(" ", JLabel.CENTER);

    BlackJack() {
        setTitle("Blackjack 1.0");
        setResizable(false);
        setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);

        // hit, stick, and deal buttons
        JPanel buttons = new JPanel();
        buttons.add(hitButton);
        buttons.add(stickButton);
        buttons.add(dealButton);
        hitButton.addActionListener(this);
        stickButton.addActionListener(this);
        dealButton.addActionListener(this);
        hitButton.setEnabled(false);
        stickButton.setEnabled(false);

        // add the dealer, gambler, buttons, and status bar
        getContentPane().setLayout(new BoxLayout(getContentPane(), BoxLayout.Y_AXIS));
        getContentPane().add(main);
        getContentPane().add(buttons);
        getContentPane().add(status);

        draw.setCanvasSize(WIDTH, HEIGHT);
        draw.setXscale(0, WIDTH);
        draw.setYscale(0, HEIGHT);
        pack();
        setVisible(true);
    }


    // deal one card to given player from the deck
    public void hit(Player player) {
        player.dealTo(deck.dealFrom());
        player.draw(draw);
        main.repaint();
    }

    // deal out two cards each, shuffling if too few cards
    public void deal() {
        draw.clear(Color.GRAY);
        gambler.reset();
        dealer.reset();
        if (deck == null || deck.size() < 15) {
            deck = new Deck();
            deck.shuffle();
            status.setText("Shuffling");
        }
        hit(gambler);
        hit(dealer);
        dealer.peak().conceal();     // hide the dealer's first card
        hit(gambler);
        hit(dealer);
    }

    // who won?
    public void checkWinner() {
        dealer.peak().reveal();        // time to reveal dealer's card
        dealer.draw(draw);
        main.repaint();
        if      (gambler.value() >  21)             status.setText("Gambler busts");
        else if (dealer.value()  >  21)             status.setText("Dealer busts");
        else if (gambler.value() == dealer.value()) status.setText("Push");
        else if (gambler.value() >  dealer.value()) status.setText("Gambler wins");
        else                                        status.setText("Dealer wins");
        StdOut.println(status.getText());
    }

    // process a button push
    public void actionPerformed(ActionEvent e) {
        if (e.getSource() == hitButton) {
            hit(gambler);
            if(gambler.value() > 21) {
                checkWinner();
                hitButton.setEnabled(false);
                stickButton.setEnabled(false);
                dealButton.setEnabled(true);
            }
        }

        if (e.getSource() == stickButton) {
            while(dealer.value() < 17)
                hit(dealer);
            checkWinner();
            hitButton.setEnabled(false);
            stickButton.setEnabled(false);
            dealButton.setEnabled(true);
        }

        if (e.getSource() == dealButton) {
            deal();
            status.setText(" ");
            hitButton.setEnabled(true);
            stickButton.setEnabled(true);
            dealButton.setEnabled(false);
        }
    }


    // play Blackjack
    public static void main(String argv[]) {
        new BlackJack();
    }

}
